// Contactinfo.js

import './Personal.css';

import React from "react";
import Editablefield from './Editablefield'

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'


import { faSave } from '@fortawesome/free-solid-svg-icons';



const Personal = () => {
	return (
		<div className="personal">
			<div className="personal-info">
				<Editablefield value='First Name' tag='h1' />
				<Editablefield value='Last Name' tag='h1' />
				<Editablefield value='Occupation' tag='h5' />
			</div>

			<div className="contact">
				<Editablefield value='Address Line 1' tag='p' />
				<Editablefield value='Address Line 2' tag='p' />
				<Editablefield value='Town/City' tag='p' />
				<Editablefield value='Country' tag='p' />
				<Editablefield value='Post Code' tag='p' />
				<Editablefield value='Phone' tag='p' />
				<Editablefield value='Email' tag='p' />

			</div>
		</div>
	)
}

export default Personal;
